import Typewriter from 'typewriter-effect';

export default function Home() {
    return (

        <div className="container ">
            <Typewriter
                options={{
                    strings: ['designer', 'gamer', 'researcher', 'developer'],
                    autoStart: true,
                    loop: true,
                    delay: 60,
                    deleteSpeed: 30,
                    pauseFor: 250,
                }}
            />
        </div>
        // <div className="container ">
        //     <p>Hello, <br />
        //         my name is Yung-Chu, <br />
        //         and I am a <span className="typed-text" ></span><span className="cursor">&nbsp;</span></p>
        // </div>
    );
};
